class Solution:
    def generateParenthesis(self, n: int) -> List[str]:
        if n == 0:
            return []

        dp = [[] for _ in range(n + 1)]
        dp[0] = ['']

        for i in range(1, n + 1):
            for j in range(i):
                for left in dp[j]:
                    for right in dp[i - j - 1]:
                        dp[i].append('(' + left + ')' + right)

        return dp[n]

def test_generate_parenthesis():
    sol = Solution()

    # Test case 1
    n = 3
    print(sol.generateParenthesis(n))  # Expected output: ["((()))","(()())","(())()","()(())","()()()"]

    # Test case 2
    n = 1
    print(sol.generateParenthesis(n))  # Expected output: ["()"]

    # Test case 3
    n = 2
    print(sol.generateParenthesis(n))  # Expected output: ["(())", "()()"]

    # Test case 4
    n = 4
    print(sol.generateParenthesis(n))  # Expected output: ["(((())))","((()()))","((())())","((()))()","(()(()))","(()()())","(()())()","(())(())","(())()()","()((()))","()(()())","()(())()","()()(())","()()()()"]

test_generate_parenthesis()